import React, {Component} from 'react';
import Paper from '@material-ui/core/Paper';
import {
  FilteringState,
  IntegratedFiltering,
} from '@devexpress/dx-react-grid';
import {
  Grid,
  Table,
  TableHeaderRow,
  TableFilterRow,
} from '@devexpress/dx-react-grid-material-ui';

import './SummaryTable.css';

export default class SummaryTable extends Component {
  constructor(props) {
    super(props);

    this.state = {
      columns: [
        { name: 'date', title: 'Date' },
        { name: 'input beans', title: 'Input Beans' },
        { name: 'input weight', title: 'Weight' },
        { name: 'output beans', title: 'Output Beans' },
        { name: 'output weight', title: 'Weight' },
        { name: 'car', title: 'Car' },
      ],
      rows: [
        { name: 'name', title: 'Name' },
        { name: 'sex', title: 'Sex' },
        { name: 'city', title: 'City' },
        { name: 'car', title: 'Car' },
      ],
    };
  }

  render() {
    const { rows, columns } = this.state;

    return (
      <div className="output-table">
        <Paper>
          <Grid
            rows={rows}
            columns={columns}
          >
            {/* <FilteringState defaultFilters={[]} /> */}
            <IntegratedFiltering />
            <Table />
            <TableHeaderRow />
            <TableFilterRow />
          </Grid>
        </Paper>
      </div>  
    );
  }
}
